function makeDom(e){var n=new htmlparser.DomHandler,t=new htmlparser.Parser(n);return t.write(e),t.done(),n.dom}var CSSselect=require(".."),htmlparser=require("htmlparser2"),assert=require("assert");describe("API",function(){describe("removes duplicates",function(){it("between identical trees",function(){var e=makeDom("<div></div>")[0],n=CSSselect("div",[e,e]);assert.equal(n.length,1,"Removes duplicate matches")}),it("between a superset and subset",function(){var e=makeDom("<div><p></p></div>")[0],n=CSSselect("p",[e,e.children[0]]);assert.equal(n.length,1,"Removes duplicate matches")}),it("betweeen a subset and superset",function(){var e=makeDom("<div><p></p></div>")[0],n=CSSselect("p",[e.children[0],e]);assert.equal(n.length,1,"Removes duplicate matches")})})});